$data = json_decode($json, true);

$offers = $data['AirShoppingRS']['OffersGroup']['AirlineOffers'] ?? [];
$flightList = $data['AirShoppingRS']['DataLists']['FlightList'] ?? [];
$segmentList = $data['AirShoppingRS']['DataLists']['FlightSegmentList'] ?? [];

// Loop each airline offer
foreach ($offers as $airlineOffer) {
    foreach ($airlineOffer['Offer'] as $offer) {
        $offerItem = $offer['OfferItem'][0];
        $flightRefs = $offerItem['Service'][0]['FlightRefs'] ?? ''; // e.g. "Flight1"

        // Find matching flight in FlightList
        $flight = null;
        foreach ($flightList as $f) {
            if ($f['FlightID'] == $flightRefs) {
                $flight = $f;
                break;
            }
        }

        if (!$flight) continue; // skip if no match

        $segmentRefs = (array)$flight['SegmentReferences'];
        $segments = [];

        // Collect all segment details
        foreach ($segmentRefs as $ref) {
            foreach ($segmentList as $segment) {
                if ($segment['SegmentID'] == $ref) {
                    $segments[] = $segment;
                }
            }
        }

        if (empty($segments)) continue;

        // Use first and last segments for times
        $first = reset($segments);
        $last  = end($segments);

        $airlineCode = $first['MarketingCarrier']['AirlineID'] ?? '';
        $depTime = date('H:i', strtotime($first['Departure']['DateTime']));
        $arrTime = date('H:i', strtotime($last['Arrival']['DateTime']));
        $depAirport = $first['Departure']['AirportCode'] ?? '';
        $arrAirport = $last['Arrival']['AirportCode'] ?? '';
        $duration = formatDuration($first['FlightDuration']);
        $stops = ($first['StopQuantity'] ?? 0) == 0 ? 'Nonstop' : $first['StopQuantity'] . ' Stop(s)';
        $price = $offer['TotalPrice']['BookingCurrencyPrice'] . ' ' . $offer['BookingCurrencyCode'];
?>
        <div class="flight-card" style="display:flex;justify-content:space-between;align-items:center;border:1px solid #eee;padding:20px;border-radius:10px;margin-bottom:15px;">
