                <img src="https://content.airhex.com/content/logos/<?php echo $airlineCode; ?>_200_200_r.png" alt="logo" style="width:40px;height:40px;border-radius:50%;">
                <div>
                    <div><strong><?php echo $depTime; ?></strong> → <strong><?php echo $arrTime; ?></strong></div>
                    <div><?php echo $depAirport; ?> → <?php echo $arrAirport; ?></div>
                    <div><?php echo $stops; ?> · <?php echo $duration; ?></div>
                </div>
            </div>
            <div class="right">
                <div style="font-size:18px;font-weight:600;"><?php echo $price; ?></div>
                <a href="#" class="btn" style="display:inline-block;margin-top:8px;padding:8px 16px;background:#3b82f6;color:white;border-radius:5px;text-decoration:none;">View Deal</a>
            </div>
        </div>
<?php
